import { useEffect } from 'react';

const Navigation = () => {
  /* henter nav-data fra sanity */
  useEffect(() => {
    const fetchDataAsync = async () => {
      setLoading(true);
      try {
        const navigation = await getNav('Header');
        setData(navigation);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };
    fetchDataAsync();
  }, []);
};
export default Navigation;
